import React, { Component } from "react";
import { observer, inject } from "mobx-react";
import Kakaomap from "./Kakaomap";

@inject("pos")
@observer
class Mask extends Component {
  render() {
    const { pos } = this.props;
    pos.getPosition2();
    return (
      <div className="main">
        <React.Fragment>
          
          <h1>
            mask ì•¼ {pos.mylat}, {pos.mylng}
          </h1>
        
          <Kakaomap mylat={pos.mylat}/>
        </React.Fragment>
      </div>
    );
  }
}

export default Mask;
